addEventListener('fetch', (e) => {
  let { pathname } = new URL(e.request.url)
  if (pathname.endsWith('/')) {
    pathname += 'index.html'
  }
  let data = dirData[pathname]
  if (!data) {
    data = dirData[pathname + '.html']
  }
  if (data) {
    const [bytes, mediaType, etag, cacheControl] = data
    const acceptsGzip = e.request.headers
      .get('accept-encoding')
      ?.split(/[,;]s*/)
      .includes('gzip')
    if (e.request.headers.get('if-none-match') === etag) {
      e.respondWith(
        new Response(null, { status: 304, statusText: 'Not Modified' })
      )
      return
    }
    if (acceptsGzip) {
      e.respondWith(
        new Response(bytes, {
          headers: {
            etag,
            'cache-control': cacheControl,
            'content-type': mediaType,
            'content-encoding': 'gzip',
          },
        })
      )
    } else {
      e.respondWith(
        new Response(gunzip(bytes), {
          headers: {
            etag,
            'cache-control': cacheControl,
            'content-type': mediaType,
          },
        })
      )
    }
    return
  }
  e.respondWith(new Response('404 Not Found', { status: 404 }))
})
